import ".././styles/NewsCard.css";
import ".././styles/styles.css";
function NewsCard({image, title, date, description}) {
    return(
        <div class="news-card button-shadow">
            <img id="news-picture" src={image} alt=""></img>
            <div id="news-details">
                <h3 id="news-title">
                    {title}
                </h3>
                <p id="news-date">
                    {date}
                </p>
                <p id="news-description">
                    {description}
                </p>
                <a id="news-link">
                    read more
                </a>
            </div>
        </div>
    );
}

export default NewsCard;
